import React, { useState, useEffect } from 'react';
import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

const Navbar  = () => {
    return (
       <header className="conatiner-fluid">
            <nav className="container-fluid">
                <Container>
                    <Row>
                    <Col>
                    <Logo /> 
                    </Col>
                    <Col>   
                    <NavElements />
                    </Col>
                    </Row>
                </Container>    
               </nav>
       </header>
    )
}

const NavElements = () => {
return (
    <ul className="nav-parent col-6">
        <li className="nav-element">Ãœber Uns</li>
        <li className="nav-element">Mitgliedschaft</li>
        <li className="nav-element">Anfahrt</li>
        <li className="nav-element">Liga</li>
        <li className="nav-element">Kontakt</li>
    </ul>
);
}

const Logo = () => {
return (
<Col>
    <div className="logo-container col-6">
        <img className="logo" src="./public/img/DFGP_Logo.jpg"></img>
    </div>
</Col>
);
}

export default Navbar;
